// src/Products.js
import React from 'react';
import { Card, Button, Container, Row, Col } from 'react-bootstrap';

const products = [
  {
    id: 1,
    name: 'Product 1',
    price: '$19.99',
    description: 'This is a short description of product 1.',
    image: 'https://encrypted-tbn2.gstatic.com/shopping?q=tbn:ANd9GcTaZ8Eb9KQ0P2S-KkohTpUdRhS29y39B7REoQncGxxCxne5SsKqXYoSFZxYyPrpvZ6CM-RcDQcXPvp6JbFCNbE4wVTuiDk6A8n8Ppq_UOVM22KKE7vC4wdo-4qSOKIGNurZHl7MR4J1Mw&usqp=CAc'
  },
  {
    id: 2,
    name: 'Product 2',
    price: '$29.99',
    description: 'This is a short description of product 2.',
    image: 'https://via.placeholder.com/150'
  },
  {
    id: 3,
    name: 'Product 3',
    price: '$39.99',
    description: 'This is a short description of product 3.',
    image: 'https://via.placeholder.com/150'
  },
  {
    id: 4,
    name: 'Product 4',
    price: '$49.99',
    description: 'This is a short description of product 4.',
    image: 'https://via.placeholder.com/150'
  },
  {
    id: 5,
    name: 'Product 5',
    price: '$59.99',
    description: 'This is a short description of product 5.',
    image: 'https://via.placeholder.com/150'
  },
  {
    id: 6,
    name: 'Product 6',
    price: '$69.99',
    description: 'This is a short description of product 6.',
    image: 'https://via.placeholder.com/150'
  }
];

const ProductCard = ({ product }) => (
  <Col sm={12} md={6} lg={4} className="mb-4">
    <Card>
      <Card.Img variant="top" src={product.image} />
      <Card.Body>
        <Card.Title>{product.name}</Card.Title>
        <Card.Text>{product.description}</Card.Text>
        <Card.Text>{product.price}</Card.Text>
        <Button variant="primary">Add to Cart</Button>
      </Card.Body>
    </Card>
  </Col>
);

const GradProducts = () => (
  <Container>
    <Row>
      {products.map((product) => (
        <ProductCard key={product.id} product={product} />
      ))}
    </Row>
  </Container>
);

export default GradProducts;
